INSERT INTO `px_post` (`id`, `title`, `seo_url`, `seo_keyword`, `description`, `feature_img`, `tag`, `owner`, `created`, `lastupdated`) VALUES
(7, 'Lừa và câu chuyện bạn cần phải biết', 'lua-va-cau-chuyen-ban-can-phai-biet', 'Lừa và câu chuyện bạn cần phải biết', '<p><br class="Apple-interchange-newline" /><img class=" size-medium wp-image-79 aligncenter" src="http://www.caphedang.net/wp-content/uploads/2015/07/bac-nong-dan-va-con-lua-1-300x200.png" alt="bac-nong-dan-va-con-lua-1" /></p>\r\n<h4>Người n&ocirc;ng d&acirc;n k&ecirc;u h&agrave;ng x&oacute;m của &ocirc;ng đến v&agrave; gi&uacute;p một tay. Họ cầm xẻng v&agrave; bắt đầu x&uacute;c đất đổ xuống giếng. Ban đầu, con lừa biết chuyện g&igrave; xảy ra v&agrave; n&oacute; bắt đầu kh&oacute;c v&igrave; tuyệt vọng. Nhưng sau đ&oacute; mọi người ngạc nhi&ecirc;n v&igrave; n&oacute; bổng trở n&ecirc;n im lặng.</h4>\r\n<h4>Một l&uacute;c sau người n&ocirc;ng d&acirc;n nh&igrave;n xuống giếng v&agrave; &ocirc;ng ta kh&ocirc;ng khỏi ngạc nhi&ecirc;n v&igrave; những g&igrave; đ&atilde; xảy ra trước mắt. Với mỗi xẻng đất m&agrave; người ta hất xuống giếng, con lừa đ&atilde; l&agrave;m một việc th&ocirc;ng minh, n&oacute; lay người để giũ cho đất v&agrave; b&ugrave;n rơi xuống ch&acirc;n v&agrave; tiếp tục bước l&ecirc;n.</h4>\r\n<h4>Với mỗi x&uacute;c đất của người d&acirc;n hất xuống, con lừa lại rung m&igrave;nh &nbsp;v&agrave; bước một bước l&ecirc;n tr&ecirc;n đống đất. Chỉ sau một l&uacute;c, mọi người đều kinh ngạc v&igrave; con lừa đ&atilde; l&ecirc;n được miệng giếng v&agrave; vui vẻ tho&aacute;t ra ngo&agrave;i.</h4>\r\n<h4>B&agrave;i học r&uacute;t ra:</h4>\r\n<h4>Cuộc sống c&oacute; thể hất b&ugrave;n đất l&ecirc;n bạn. C&aacute;ch duy nhất để bước ra khỏi c&aacute;i giếng của tuyệt vọng đ&oacute; l&agrave; h&atilde;y rũ bỏ kh&oacute; khăn v&agrave; tiếp tục bước l&ecirc;n. Ch&uacute;ng ta chỉ c&oacute; thể tho&aacute;t khỏi vực thẳm bằng việc đừng bao giờ từ bỏ. H&atilde;y vượt qua n&oacute; chứ đừng đầu h&agrave;ng.</h4>', '["de4f4c5a6d472de91c627ac91b664b3f.png"]', 'Lừa và câu chuyện bạn cần phải biết', 6, '2015-08-09 08:06:58', '2015-08-09 08:06:58'),
(8, 'Chuyện tình thằng Sida (Part 5)', 'chuyen-tinh-thang-sida-part-5-', 'Chuyện tình thằng Sida (Part 5)', '<p>Tạm biệt Sang, c&ocirc; g&aacute;i đ&atilde; nhận ra bản chất thật của Sida v&agrave; ch&uacute;ng ta lại đến với 1 nhận vật mới : 1 anh trai t&ecirc;n Vụ, đồng nghiệp của Sang , Vụ chơi kh&aacute; th&acirc;n với Long, v&agrave; anh l&agrave; 1 lập tr&igrave;nh vi&ecirc;n&nbsp;<img class="emoji" draggable="false" src="http://s.w.org/images/core/emoji/72x72/1f61b.png" alt="', '["b8570a7ff913116ca5d8db4cccd96be7.jpeg"]', 'Chuyện tình thằng Sida (Part 5)', 1, '2015-08-13 09:01:33', '2015-08-13 09:01:33');
