(82, 'PRO170812602782', '639913-010S', '639913-010S', 1, 5, NULL, '["fairway\\/AO NIKE\\/639913-010.jpg","fairway\\/AO NIKE\\/major-moment-polo-639913-100-back.jpg"]', '639913-010s', 86, 1500000, NULL, 0, NULL, NULL, NULL, NULL, 1, 1, NULL, '639913-010S 639913-010s Áo 639913-010s new products', '639913-010S 639913-010s Áo 639913-010s new products', '<h3><strong><span style="font-size:18px"><span style="font-family:times new roman,times,serif"><span style="color:rgb(0, 0, 0)">The Major Moment Polo from Nike is new for the 2015 collection. This lightweight and breathable polo is equipped with Dri-Fit technology to wick moisture away from the skin and keep you cool and comfortable. Designed with a button placket, rib collar and open sleeves, a combination of style and comfort was what Nike had in mind when creating this classic model. The Major Moment Polo was also built with stretch properties to provide you an enhanced range of motion so your swing flows unhindered.</span></span></span></strong></h3>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><strong><span style="font-size:18px"><span style="font-family:times new roman,times,serif">100% polyester</span></span></strong></h3>\r\n	</li>\r\n	<li>\r\n	<h3><strong><span style="font-size:18px"><span style="font-family:times new roman,times,serif">Dri-Fit technology</span></span></strong></h3>\r\n	</li>\r\n	<li>\r\n	<h3><strong><span style="font-size:18px"><span style="font-family:times new roman,times,serif">Stretch</span></span></strong></h3>\r\n	</li>\r\n	<li>\r\n	<h3><strong><span style="font-size:18px"><span style="font-family:times new roman,times,serif">Open sleeves</span></span></strong></h3>\r\n	</li>\r\n	<li>\r\n	<h3><strong><span style="font-size:18px"><span style="font-family:times new roman,times,serif">Button placket</span></span></strong></h3>\r\n	</li>\r\n</ul>', '639913-010s, new, products', 1, 1, '2015-07-26 00:54:05', '2015-07-26 00:55:14'),
(83, 'PRO170812172783', '639950-374M', '639950-374M', 1, 5, NULL, '["fairway\\/AO NIKE\\/639950-374.JPG"]', '639950-374m', 86, 1500000, NULL, 0, NULL, NULL, NULL, NULL, 1, 1, NULL, '639950-374M 639950-374m Áo 639950-374m new products', '639950-374M 639950-374m Áo 639950-374m new products', '<h4><strong><span style="color:rgb(56, 176, 227); font-size:20px"><span style="font-family:times new roman,times,serif"><span style="color:rgb(98, 103, 107)">Nike Dri-Fit fabric to wick sweat away and to keep you dry and comfortable.&nbsp;<br />\r\nFold-over collar and 2-button placket for classic polo styling. Open sleeves for enhanced range of motion.&nbsp;<br />\r\n​Vented hem for comfortable fit. Stylish 2-color print fade stripe design across chest with a solid back.</span></span></span></strong></h4>', '639950-374m, new, products', 1, 1, '2015-07-26 01:07:14', '0000-00-00 00:00:00');
