(90, 'PRO170812782890', 'NIKE RZN GOLF BALLS GL0654-101', 'GL0654 101', 1, 5, NULL, '["bong\\/rzn-red-golf-balls.jpg","bong\\/rzn-red-golf-balls.jpg","bong\\/rzn-red-golf-balls-white.jpg","bong\\/rzn-red-golf-balls-alt.jpg","bong\\/rzn-red-golf-balls-cutaway.jpg"]', 'nike-rzn-golf-balls-gl0654-101', 17, 818182, NULL, 0, NULL, NULL, NULL, NULL, 5, 1662, NULL, 'NIKE RZN GOLF BALLS GL0654-101 nike rzn golf balls gl0654-101 bóng golf tee', 'NIKE RZN GOLF BALLS GL0654-101 nike rzn golf balls gl0654-101 bóng golf tee', '<p>NIKE RZN GOLF BALLS GL0654-101</p>\r\n\r\n<p style="margin: 10px auto; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; font-family: arial, sans-serif; color: rgb(0, 0, 0); line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">RZN (resin) material, as always, is designed for longer distance and a more consistent, stable ball flight. Its lightweight core allows more weight to be moved to the perimeter of the ball, increasing stability. A new coating on the outer surface is designed to grip the grooves for better control on wedge and iron shots.</p>\r\n\r\n<ul style="margin: 10px 0px 10px 25px; padding-right: 0px; padding-left: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; font-family: arial, sans-serif; color: rgb(0, 0, 0); line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">\r\n	<li style="margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; background: transparent;">3-piece golf ball</li>\r\n	<li style="margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; background: transparen