(235, 'PRO1708129443235', 'SHAFT FUJIKURA ROMBAX TYPE X 55 (R)', 'SHAFT5.1', 1, 33, NULL, '["gay-moi-thang-11\\/1660062891.jpg","gay-moi-thang-11\\/1660062891_1.jpg","gay-moi-thang-11\\/1660062891.jpg"]', 'shaft-fujikura-rombax-type-x-55-r-', 34, 2230000, NULL, 0, NULL, NULL, NULL, NULL, 1, 890, NULL, 'SHAFT FUJIKURA ROMBAX TYPE X 55 (R) shaft fujikura rombax type (r) phụ kiện khác shaft fujikura rombax type (r) shaft', 'SHAFT FUJIKURA ROMBAX TYPE X 55 (R) shaft fujikura rombax type (r) phụ kiện khác shaft fujikura rombax type (r) shaft', '<p style="font-size: 13.3333339691162px; line-height: 20.7999992370605px;">This Shaft is new, no wear marks on paint or tip.&nbsp;</p>\r\n\r\n<p style="font-size: 13.3333339691162px; line-height: 20.7999992370605px;">A great addition to any golfer who requires distance and accuracy off the tee.</p>\r\n\r\n<p style="font-size: 13.3333339691162px; line-height: 20.7999992370605px;">New for 2012, the next generation of Rombax shafts. Rombax Type-X features Vectran in combination with Kevlar Triax. Vectran fibers suppress the immediate vibration of a shaft more efficiently. Kevlar Triax reduces ovaling and stabilizes the head at impact. The blend of these two technologies produces a strong and stable impact, resulting in greater power and control.</p>\r\n\r\n<table border="0" cellpadding="0" cellspacing="0" style="font-size: 13.3333339691162px; line-height: 20.7999992370605px; width: 294px;" width="294">\r\n	<colgroup>\r\n		<col />\r\n		<col />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height="22">\r\n			<td height="22" style="height: 22px; width: 158px;">CLASSIFICATION</td>\r\n			<td style="width: 138px;">SHAFT</td>\r\n		</tr>\r\n		<tr height="22">\r\n			<td height="22" style="height: 22px; width: 158px;">BRAND</td>\r\n			<td style="width: 138px;">FUJIKURA</td>\r\n		</tr>\r\n		<tr height="22">\r\n			<td height="22" style="height: 22px; width: 158px;">MODEL</td>\r\n			<td style="width: 138px;">ROMBAX 5X07</td>\r\n		</tr>\r\n		<tr height="22">\r\n			<td height="22" style="height: 22px; width: 158px;">FLEX</td>\r\n			<td style="width: 138px;">R</td>\r\n		</tr>\r\n		<tr height="22">\r\n			<td height="22" style="height: 22px; width: 158px;">LENGTH</td>\r\n			<td style="width: 138px;">47 inch</td>\r\n		</tr>\r\n		<tr height="22">\r\n			<td height="22" style="height: 22px; width: 158px;">WEGHT</td>\r\n			<td style="width: 138px;">54.5 gr</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 'shaft, fujikura, rombax, type, (r)', 1, 1, '2014-11-20 10:11:22', '2014-12-14 16:34:30'),
(236, 'PRO1708126843236', 'SHAFT FUJIKURA MOTORE SPEEDER VC 6.0', 'SHAFT5.2', 1, 33, NULL, '["gay-moi-thang-11\\/1660060286.jpg","gay-moi-thang-11\\/1660060286.jpg","gay-moi-thang-11\\/1660060286_1.jpg"]', 'shaft-fujikura-motore-speeder-vc-6-0', 34, 3350000, NULL, 0, NULL, NULL, NULL, NULL, 1, 155, NULL, 'SHAFT FUJIKURA MOTORE SPEEDER VC 6.0 shaft fujikura motore speeder 6.0 phụ kiện khác shaft fujikura motore speeder 6.0 shaft', 'SHAFT FUJIKURA MOTORE SPEEDER VC 6.0 shaft fujikura motore speeder 6.0 phụ kiện khác shaft fujikura motore speeder 6.0 shaft', '<p>The Fujikura Motore Speeder VC6.0 is constructed to assist the average golfer with their carry distance. Not specifically built for seniors, however still a good shaft for the older golfer as well with a mid/high launch and a mid/high spin.&nbsp;</p>\r\n\r\n<p>The Speeder VC6.0 is better for the higher swing speed seniors, or the average swing speed younger golfer. For the lower swing speed golfers, the VC5.0 is a better fit.</p>\r\n\r\n<p>Please choose the model and adapter from the menu below. We presently sell completely built shafts with adapters for the following brands: TaylorMade, Titleist, Callaway, Ping, Adams, Nakashima, Nike, and Cobra.</p>\r\n\r\n<p>The built shaft/adapter can be cut to length using the Club Finished Length menu selection. This total length will be the length of the club after shaft is installed, not simply the length of the shaft.</p>\r\n\r\n<table border="0" cellpadding="0" cellspacing="0" style="width:354px;" width="354">\r\n	<colgroup>\r\n		<col />\r\n		<col />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height="22">\r\n			<td height="22" style="height:22px;width:158px;">CLASSIFICATION</td>\r\n			<td style="width:198px;">SHAFT</td>\r\n		</tr>\r\n		<tr height="22">\r\n			<td height="22" style="height:22px;width:158px;">BRAND</td>\r\n			<td style="width:198px;">FUJIKURA</td>\r\n		</tr>\r\n		<tr height="22">\r\n			<td height="22" style="height:22px;width:158px;">MODEL</td>\r\n			<td style="width:198px;">MOTORE SPEEDER VC 6.0</td>\r\n		</tr>\r\n		<tr height="22">\r\n			<td height="22" style="height:22px;width:158px;">FLEX</td>\r\n			<td style="width:198px;">S</td>\r\n		</tr>\r\n		<tr height="22">\r\n			<td height="22" style="height:22px;width:158px;">LENGTH</td>\r\n			<td style="width:198px;">46 inch</td>\r\n		</tr>\r\n		<tr height="22">\r\n			<td height="22" style="height:22px;width:158px;">WEGHT</td>\r\n			<td style="width:198px;">67 gr</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 'shaft, fujikura, motore, speeder, 6.0', 1, 1, '2014-11-20 10:23:33', '2014-12-16 15:57:21'),
