(490, 'PRO1808123210490', 'Grip Putter Super Stroke Fatso 5.0', 'GRPUT004', 1, 0, NULL, '["grip\\/fatso-black.png"]', 'grip-putter-super-stroke-fatso-5-0', 34, 800000, NULL, 0, NULL, NULL, NULL, NULL, 1, 305, NULL, 'Grip Putter Super Stroke Fatso 5.0 grip putter super stroke fatso 5.0 phụ kiện golf grip putter super stroke fatso 5.0 grip grip putter super stroke fatso 5.0 new products', 'Grip Putter Super Stroke Fatso 5.0 grip putter super stroke fatso 5.0 phụ kiện golf grip putter super stroke fatso 5.0 grip grip putter super stroke fatso 5.0 new products', '<h3><strong><span style="font-size:20px"><span style="color:rgb(255, 0, 0)"><span style="font-family:comic sans ms,cursive">Fatso 5.0</span></span></span></strong><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive">USGA Approved<br />\r\n1.67&rdquo; Diameter<br />\r\n10.50&quot; Length<br />\r\n90 Grams +/- 5<br />\r\n0.580&quot; Core<br />\r\nThe largest offering in the SuperStroke line, the Fatso 5.0 maximizes our patented parallel technology and complements a &ldquo;straight-back, straight-through&rdquo; putting technique.</span></span></span><br />\r\n<strong><span style="color:rgb(0, 0, 255)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive">The Fastest Growing Putter Grips on the Tour</span></span></span></strong><br />\r\n<span style="color:rgb(0, 0, 0)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive">With over 125 tour players having used SuperStroke technology, our patented grips help the world&rsquo;s best play better every week. The proof: Over $50 million won on Tour.</span></span></span><br />\r\n<strong><span style="color:rgb(0, 0, 255)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive">Patented Parallel Design</span></span></span></strong><br />\r\n<span style="color:rgb(0, 0, 0)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive">Our parallel technology allows for even pressure in both hands, eliminating added tension in the wrist and forearms. This helps the arms to swing free, further enhancing a pendulum putting stroke.</span></span></span><br />\r\n<strong><span style="color:rgb(0, 0, 255)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive">New Material with CrossTraction Technology</span></span></span></strong><br />\r\n<span style="color:rgb(0, 0, 0)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive">Starting with a light-weight foam under listing, we have added a new high-tech PU material, featuring CrossTraction technology, for improved feel and tackiness.</span></span></span><br />\r\n<strong><span style="color:rgb(0, 0, 255)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive">Slip-On Design</span></span></span></strong><br />\r\n<span style="color:rgb(0, 0, 0)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive">SuperStroke putter grips have a traditional installation process. Simply use double-sided tape and grip solvent to apply. Click on the &ldquo;how-to&rdquo; for step-by-step instructions.</span></span></span></h3>', 'grip, putter, super, stroke, fatso, 5.0, new, products', 1, 1, '2015-04-14 00:47:25', '0000-00-00 00:00:00'),
