(561, 'PRO1808121717561', 'Grip Putter Super Stroke Ultra Slim 1.0', 'GRPUT007', 1, 0, NULL, '["grip\\/ultraslim-red.png"]', 'grip-putter-super-stroke-ultra-slim-1-0', 34, 600000, NULL, 0, NULL, NULL, NULL, NULL, 1, 254, NULL, 'Grip Putter Super Stroke Ultra Slim 1.0 grip putter super stroke ultra slim 1.0 phụ kiện golf grip putter super stroke ultra slim 1.0 grip grip putter super stroke ultra slim 1.0 new products', 'Grip Putter Super Stroke Ultra Slim 1.0 grip putter super stroke ultra slim 1.0 phụ kiện golf grip putter super stroke ultra slim 1.0 grip grip putter super stroke ultra slim 1.0 new products', '<h3><span style="font-size:20px"><span style="color:rgb(255, 0, 0)"><span style="font-family:comic sans ms,cursive"><strong>Ultra Slim 1.0</strong></span></span></span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive">USGA Approved<br />\r\n1.00&rdquo; diameter<br />\r\n10.50&quot; Length<br />\r\n65 Grams +/- 5<br />\r\n0.580&quot; Core<br />\r\nThe smallest SuperStroke offering, the Ultra Slim 1.0, gives players using standard-sized grips an entry into our parallel technology. This grip offers all the benefits of a SuperStroke grip without the oversized feel. The Ultra Slim 1.0 was used in 3 worldwide victories last year.</span></span></span><br />\r\n<br />\r\n<strong><span style="color:rgb(0, 0, 255)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive">The Fastest Growing Putter Grips on the tour</span></span></span></strong><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive">With over 125 tour players having used SuperStroke technology, our patented grips help the world&rsquo;s best play better every week. The proof: Over $100 million won on Tour.</span></span></span><br />\r\n<br />\r\n<strong><span style="color:rgb(0, 0, 255)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive">Patented Parallel Design</span></span></span></strong><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive">Our parallel technology allows for even pressure in both hands, eliminating added tension in the wrist and forearms. This helps the arms to swing free, further enhancing a pendulum putting stroke.</span></span></span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 255)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive"><strong>New Material with CrossTraction Technology</strong></span></span></span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive">Starting with a rubber under listing, we have added a new high-tech PU material, featuring CrossTraction technology, for improved feel and tackiness.</span></span></span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 255)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive"><strong>Slip-On Design</strong></span></span></span><br />\r\n<br />\r\n<span style="color:rgb(0, 0, 0)"><span style="font-size:18px"><span style="font-family:comic sans ms,cursive">SuperStroke putter grips have a traditional installation process. Simply use double-sided tape and grip solvent to apply. Click on the &ldquo;how-to&rdquo; for step-by-step instructions.</span></span></span></h3>', 'grip, putter, super, stroke, ultra, slim, 1.0, new, products', 1, 1, '2015-04-14 00:42:08', '2015-04-14 00:49:16'),
