(597, 'PRO1808122621597', 'Golf Pride CP2 Wrap Grip', 'GRGOL12', 1, 0, NULL, '["grip\\/cp2 wrap.png","grip\\/t\\u1ea3i xu\\u1ed1ng.jpg","grip\\/cp2-wrap.png"]', 'golf-pride-cp2-wrap-grip', 34, 350000, NULL, 0, NULL, NULL, NULL, NULL, 1, 181, NULL, 'Golf Pride CP2 Wrap Grip golf pride cp2 wrap grip phụ kiện golf golf pride cp2 wrap grip grip', 'Golf Pride CP2 Wrap Grip golf pride cp2 wrap grip phụ kiện golf golf pride cp2 wrap grip grip', '<h3><span style="color:#000000"><span style="font-size:18px"><span style="font-family:times new roman,times,serif">For a more traditional look, with enhanced comfort, upgrade your club with the Golf Pride CP2 Wrap Midsize Grip. Featuring a multi-texture grip surface for added traction and non-slip performance. Control core technology stabilizes your swing so you can achieve maximum launch no matter the ground conditions. A subtle strip pattern creates a unique, eye-catching look that&#39;s sure to make you the envy of your foursome.<br />\r\nColor: Black/Blue<br />\r\nCore Size: .600&quot;<br />\r\nWeight: 64g<br />\r\nInstalled Size: Standard<br />\r\nBrand: Golf Pride<br />\r\nAverage Rating: 4.7273<br />\r\nCountry of Origin: Imported from Japan</span></span></span></h3>', 'golf, pride, cp2, wrap, grip', 1, 1, '2015-04-14 00:09:35', '0000-00-00 00:00:00'),
(598, 'PRO1808120221598', 'Golf Pride CP2 Pro Grip', 'GRGOL13', 1, 0, NULL, '["grip\\/images (3).jpg","grip\\/cp2-pro.png","grip\\/cp2 pro.png"]', 'golf-pride-cp2-pro-grip', 34, 350000, NULL, 0, NULL, NULL, NULL, NULL, 1, 312, NULL, 'Golf Pride CP2 Pro Grip golf pride cp2 pro grip phụ kiện golf golf pride cp2 pro grip grip golf pride cp2 pro grip new products', 'Golf Pride CP2 Pro Grip golf pride cp2 pro grip phụ kiện golf golf pride cp2 pro grip grip golf pride cp2 pro grip new products', 'Golf Pride CP2 Pro Grip The CP2 Pro Grip is Golf Pride&#39;s softest performance, comfort grip. The exclusive Control Core technology reduces torque by 41% compared to a grip without the core, and a soft rubber with a detailed texture provides both comfort and traction. A reduced taper in the lower hand encourages lighter grip pressure.', 'golf, pride, cp2, pro, grip, new, products', 1, 1, '2015-04-14 00:17:09', '0000-00-00 00:00:00'),
